result = {}
try:
    # 1. Verifica metodi di IO pi√π dettagliati
    if hasattr(visum, 'IO'):
        io = visum.IO
        all_io_methods = [m for m in dir(io) if not m.startswith('_')]

        # Cerca metodi con 'Table', 'Attribute', 'File'
        save_methods = [m for m in all_io_methods if 'Save' in m]
        result['all_save_methods'] = save_methods

        # Cerca se esiste SaveTable o simili
        table_save = [m for m in save_methods if 'Table' in m or 'Attr' in m]
        result['table_save_methods'] = table_save

    # 2. Verifica se esistono oggetti Lists
    if hasattr(visum, 'Lists'):
        result['has_Lists'] = True
        lists = visum.Lists
        lists_methods = [m for m in dir(lists) if not m.startswith('_')]
        result['Lists_methods'] = lists_methods[:30]
    else:
        result['has_Lists'] = False

    # 3. Prova a vedere se posso accedere a tabelle tramite Net
    if hasattr(visum, 'Net'):
        net = visum.Net
        # Cerca collections principali
        collections = []
        for attr in dir(net):
            if not attr.startswith('_'):
                try:
                    obj = getattr(net, attr)
                    if hasattr(obj, 'Count'):
                        collections.append(attr)
                except:
                    pass
        result['net_collections'] = collections[:20]

except Exception as e:
    result['error'] = str(e)
result
